import "../styles/LanguageItem.css"; 

import htmlLogo from "../assets/htmlLogo.png";

function LanguageItem({ logo, name, name2, linkGithub, linkCertif }) {
  return (
    <div className="language-item">
      <div className="top-section">
        {name === "HTML5 et CSS3" ? (
          <div className="html">
            <div>
              <img src={name} alt="CSS Logo" className="logo" />
            </div>
            <div>
              <img src={name2} alt="HTML Logo" className="logo" />
            </div>
          </div>
        ) : (
          <img src={logo} alt={name} className="logo" />
        )}
        <h4>{name}</h4>
      </div>
      <div className="bottom-section">
        {linkGithub !== "" && <a href={linkGithub}>Projets Github</a>}
        {linkCertif !== "" && <a href={linkCertif}>Certification OpenclassRooms</a>}
      </div>
    </div>
  );
}

    
export default LanguageItem
